const dispatch = useDispatch();
import { useDispatch, useSelector } from "react-redux";
import { logout } from "./authSlice";
import { useNavigate } from "react-router-dom";
const Navigator = useNavigate();

const logoutUser = () => {
  logout();
  Navigator("/login");
};

module.exports = { logoutUser };
